import { hover } from '@testing-library/user-event/dist/hover'
import React from 'react'
import styled from 'styled-components'

const Container = () => {
    return (
        <StService>
            <StTitle>
                <h1>부가서비스</h1>
            </StTitle>
            <div>
                <StServiceBox>
                    <StBox><StBack></StBack><StImg><img src="https://contents-image.twayair.com/homepage/images/main/img_srv01.png" alt="" />
                        <p>부가서비스번들</p>
                    </StImg>
                    </StBox>
                    <StBox><StImg><img src="https://contents-image.twayair.com/homepage/images/main/img_srv02.png" alt="" />
                        <p>수하물 추가구매</p></StImg>
                    </StBox>
                    <StBox><StImg><img src="https://contents-image.twayair.com/homepage/images/main/img_srv03.png" alt="" />
                        <p>사전좌석구매</p></StImg></StBox>
                    <StBox><StImg><img src="https://contents-image.twayair.com/homepage/images/main/img_srv04.png" alt="" />
                        <p>기내식 사전주문</p></StImg></StBox>
                    <StBox><StImg><img src="https://contents-image.twayair.com/homepage/images/main/img_srv05.png" alt="" />
                        <p>면세품 & t`shop</p></StImg></StBox>
                    <StBox><StImg><img src="https://contents-image.twayair.com/homepage/images/main/img_srv07.png" alt="" />
                        <p>원클릭 여행보험</p></StImg>
                    </StBox>
                </StServiceBox>
            </div>
        </StService>
    )
}

export default Container

const StService = styled.div`
    width: 100%;
    padding: 50px 0;
`
const StTitle = styled.div`
    width: 1200px;
    margin: 0 auto;
    text-align: center;
`
const StServiceBox = styled.ul`
    width: 1200px;
    margin:  0 auto;
    display: flex;
    justify-content: space-between;
    list-style:none;
    position: relative;
`
const StBox = styled.li`
    width: 180px;
    height: 245px;
   display: flex;
   align-items: center;
    list-style:none ;
    position: relative;


`
const StBack = styled.div`
   opacity: 0;

`
const StImg = styled.div`
    width: 100%;
    height: 200px;
    background-color: #f3f3f3;
    text-align: center;
    :hover ${StBack}{
        background-image: url(//contents-image.twayair.com/homepage/images/main/bg_srv_on.png);
        position: absolute;
    top: 0px;

    width: 202px;
    height: 262px;
    }

`
